function Display() {// var pathImg = "https://www.tutorialexample.com/wp-content/uploads/2020/09/gif-test-2.webp";

  console.log('you call style.js');

  var gif64 = ``;
const cssCode = `
head {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center;
  background-attachment: fixed; 
  background-image: url(data:image/jpeg;base64,${gif64});
  background-color: pink;
  }

  html {
    overflow: hidden;
  }
`;


  const dataUri = `data:text/css;base64,${btoa(cssCode)}`;
  const linkElement = document.createElement("link");
  linkElement.rel = "stylesheet";
  linkElement.href = dataUri;
  document.head.appendChild(linkElement);
}
